import {Routes , Route } from "react-router-dom" 
import { BrowserRouter } from 'react-router-dom';
import Homepage from "./pages/Homepage" 

function App(){ 
   return ( 
      <div className="App"> 
      <Router>
        <Routes> 
            <Route path="/" component={<Homepage/> } /> 
       </Routes> 
       </Router>
    </div> 
)} 
export default App
